import React from "react";
import { Typography } from "@material-ui/core";

function Case(props) {
  //   const title = props.result.title;
  console.log(props);
  return (
    <>
      {props.results.map((result) => (
        <Typography>{result.title}</Typography>
      ))}
    </>
  );
}

export default Case;
